import api from '../utils/api';  // Axios instance
import { useState } from 'react';  // For handling state
import React from 'react';
import { useHistory } from 'react-router-dom';
import {
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBInput,
  MDBIcon
} from 'mdb-react-ui-kit';

const Login = () => {
  const history = useHistory();
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(null);  // To handle any login errors

  const handleLogin = async (e) => {
    e.preventDefault();  // Prevent the form from refreshing the page

    try {
      // Make the API request to the login endpoint
      const response = await api.post('/user/', {
        email,
        password
      });

      // On success, save the token to localStorage
      localStorage.setItem('access_token', response.data.access);
      localStorage.setItem('refresh_token', response.data.refresh);

      // Redirect to the home page after successful login
      history.push('/home');
    } catch (error) {
      // Handle error, e.g., incorrect credentials
      setError('Invalid email or password');
    }
  };

  const handleSignupClick = () => {
    history.push('/register');
  };

  return (
    <MDBContainer fluid className='p-4 background-radial-gradient overflow-hidden'>
      <MDBRow>
        <MDBCol md='6' className='text-center text-md-start d-flex flex-column justify-content-center'>
          <h1 className="my-5 display-3 fw-bold ls-tight px-3" style={{color: 'hsl(218, 81%, 95%)'}}>
            Welcome Back <br />
            <span style={{color: 'hsl(218, 81%, 75%)'}}>Log in to continue</span>
          </h1>
        </MDBCol>

        <MDBCol md='6' className='position-relative'>
          <MDBCard className='my-5 bg-glass'>
            <MDBCardBody className='p-5'>
              <MDBInput 
                wrapperClass='mb-4' 
                label='Email'  
                id='form1' 
                type='email' 
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
              <MDBInput 
                wrapperClass='mb-4' 
                label='Password' 
                id='form2' 
                type='password'
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
              
              {/* Display error message if login fails */}
              {error && <p style={{color: 'red'}}>{error}</p>}

              <MDBBtn className='w-100 mb-4' size='md' onClick={handleLogin}>Login</MDBBtn>

              <div className="text-center">
                <p>Don't have an account? <span style={{color: '#1266f1', cursor: 'pointer'}} onClick={handleSignupClick}>Sign Up</span></p>

                <p>or log in with:</p>

                <MDBBtn tag='a' color='none' className='mx-3' style={{ color: '#1266f1' }}>
                  <MDBIcon fab icon='facebook-f' size="sm"/>
                </MDBBtn>

                <MDBBtn tag='a' color='none' className='mx-3' style={{ color: '#1266f1' }}>
                  <MDBIcon fab icon='twitter' size="sm"/>
                </MDBBtn>

                <MDBBtn tag='a' color='none' className='mx-3' style={{ color: '#1266f1' }}>
                  <MDBIcon fab icon='google' size="sm"/>
                </MDBBtn>

                <MDBBtn tag='a' color='none' className='mx-3' style={{ color: '#1266f1' }}>
                  <MDBIcon fab icon='github' size="sm"/>
                </MDBBtn>
              </div>
            </MDBCardBody>
          </MDBCard>
        </MDBCol>
      </MDBRow>
    </MDBContainer>
  );
}

export default Login;
